import React from "react";
import { Link } from "react-router-dom";
import './home.css';
import './header.css';
import './footer.css';
import brand from './brand.png';
import homes from './homes.png';
import car from './carh.jpg';
import cs from './schedule.png';
function Home(){
    return(
        <>
         <div className='n1'>
      <Link to='/both'><input className="Loginf" type="button" value='Login' /></Link>
      <Link to='/sign'><input className="signupf" type="submit" value='Sign Up' /></Link>
    </div>
    <div className='n2'>
      <div className='c1'>Home</div>
      <Link to='/about'><div className='c2'>About Us</div></Link>
      <Link to='/help'><div className='c3'>Help</div></Link>
      <Link to='/ca'><div className='c4'>Accessories</div></Link>
      <Link to='/service'><div className='c5'>Service</div></Link>
      <div className='c6'>Remainder</div>
      <Link to='/feedback'><div className='c7'>FeedBack</div></Link>
      <div className='c8'>Contact Us</div>
      <div className='c9'>Account</div>
    <div className="screen2">
    <div className="border1">
                <img src={car} alt="Car"/>
                <div className="rishi">QUALITY CAR ASSISTANCE</div>
                <div className="sundar"></div>
                </div>
                </div>
        <div className='rs1'>Peroidic Services</div>
        <div className='rs2'>Peroidic Services</div>
        <div className='rs3'>Peroidic Services</div>
        <div className='rs4'>Peroidic Services</div>
        <div className='rs5'>Peroidic Services</div>
        <div className='rs6'>Peroidic Services</div>
        <div className='rs7'>Peroidic Services</div>
        <div className='rs8'>Peroidic Services</div>
        
        </div>
        </>
    );
}
export default Home;
